{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/skywescar/bellabeat-case-study-2023-02-03?scriptVersionId=118412798\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"085703b5","metadata":{"papermill":{"duration":0.010562,"end_time":"2023-02-06T22:42:33.208726","exception":false,"start_time":"2023-02-06T22:42:33.198164","status":"completed"},"tags":[]},"source":["#### 1. Introduction\n","This is my capstone project for the Google Data Analytics Professional program certification. It is a case study of a hypothetical scenario following the data analysis processs: ask, prepare, process, analyze, share, and act.\n","\n","##### 1.1 Scenario\n","I am a junior data analyst working on the marketing analyst team at Bellabeat, a high-tech manufacturer of health-focused\n","products for women. Bellabeat is a successful small company, but they have the potential to become a larger player in the\n","global smart device market. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart\n","device fitness data could help unlock new growth opportunities for the company. I have been asked to focus on one of\n","Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. The\n","insights you discover will then help guide marketing strategy for the company. I will present my analysis to the Bellabeat\n","executive team along with my high-level recommendations for Bellabeat’s marketing strategy.\n","\n","##### 1.2 Summary of the business task\n","Analyze smart device usage data in order to gain insight into how consumers use non-Bellabeat smart devices. How could these trends apply to Bellabeat customers? How could these trends help influence Bellabeat marketing strategy?\n","\n","#### 2. Preparing the data\n","This study analyzed data from the [FitBit Fitness Tracker Data](https://zenodo.org/record/53894#.YMoUpnVKiP9) provided by [MÖBIUS](https://www.kaggle.com/datasets/arashnic/fitbit) on Kaggle as well as the [Lifesnaps dataset](https://zenodo.org/record/7229547). Both datasets are open and ethical.\n","\n","##### 2.1 FitBit Fitness Tracker Data\n","This crowd-sourced dataset is reliable, open, and cited. It contains a distributed, anonymized sample of the population. However, it is limited to two months with thirty participants and is nearly seven years old.\n","##### 2.2 Lifesnaps Data\n","The Lifesnaps dataset was collected unobtrusively from 71 participants including a period of 9 months from 2021-04-08 to 2022-01-22. It is reliable, original and cited.\n","\n","Jump to:\n","* [Analysis](#analyze)\n","* [Share](#conclusion)\n","* [Act](#act)\n","\n","#### 3. Processing the data\n","\n"]},{"cell_type":"code","execution_count":1,"id":"919480dd","metadata":{"execution":{"iopub.execute_input":"2023-02-06T22:42:33.230346Z","iopub.status.busy":"2023-02-06T22:42:33.227404Z","iopub.status.idle":"2023-02-06T22:42:35.074701Z","shell.execute_reply":"2023-02-06T22:42:35.072648Z"},"papermill":{"duration":1.861201,"end_time":"2023-02-06T22:42:35.078308","exception":false,"start_time":"2023-02-06T22:42:33.217107","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.4.0      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 1.0.1 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.5.0 \n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.3      \u001b[32m✔\u001b[39m \u001b[34mfor