 ifelse(sum(Hours, na.rm = TRUE)<2.5,\"Sedentary\",\n","                          ifelse(sum(Hours, na.rm = TRUE)>5.0,\"Very Active\",\"Active\"))) %>% \n","  ddply(.(Activity),summarize,\n","        count = length(Activity))\n","activity_status"]},{"cell_type":"code","execution_count":28,"id":"f38a44f3","metadata":{"execution":{"iopub.execute_input":"2023-02-06T22:53:01.591046Z","iopub.status.busy":"2023-02-06T22:53:01.589267Z","iopub.status.idle":"2023-02-06T22:53:01.811912Z","shell.execute_reply":"2023-02-06T22:53:01.810096Z"},"papermill":{"duration":0.257228,"end_time":"2023-02-06T22:53:01.815138","exception":false,"start_time":"2023-02-06T22:53:01.55791","status":"completed"},"tags":[]},"outputs":[],"source":["# Preparing some charts\n","log1 <-daily_logs  %>%\n","    ggplot(aes(IsManualReport,fill=Id)) + geom_bar() +\n","ggtitle(\"Manual weight logs\")\n","\n","log2 <-daily_logs %>%\n","    ggplot(aes(LoggedActivitiesDistance,fill=Id)) + geom_bar() +\n","theme(legend.position = \"none\")\n","\n","log3 <- daily_logs %>%\n","    ggplot(aes(TotalSleepRecords,fill=Id)) + geom_bar() +\n","theme(legend.position = \"none\")\n","\n","step_goals <- sema_daily %>%\n","  select(id, step_goal_count,step_goal, steps, gender) %>%\n","  filter(!is.na(gender) & gender=='FEMALE') %>%\n","  ddply(.(id),summarize,\n","        goalRatio = sum(step_goal_count)/length(id)) %>%\n","  ggplot(aes(x = reorder(id, goalRatio, decreasing = FALSE), y = goalRatio, fill=goalRatio<0.5)) + \n","  geom_bar(stat = \"identity\") +\n","  ggtitle(\"What percent of days did female users set step goals? (Lifesnaps)\") +\n","  xlab(\"Participants\") +\n","  ylab(\"Percent of days with a step goal\") +\n","  theme(axis.text.x = element_blank()) +\n","        guides(fill=guide_legend(title=\"Less than 50% of days\"))\n","\n","# needs to be adjusted for varying days of data for each user.\n","mindfulness_chart <-sema_daily %>% select(id,mindfulness_session) %>%\n","mutate(mindfulness_session=ifelse(is.na(mindfulness_session),FALSE,mindfulness_session)) %>%\n","ggplot(aes(mindfulness_session,fill=id)) + geom_bar() +\n","theme(legend.position = \"none\")\n","\n","logs_percent_chart <- daily_logs %>% \n","ddply(.(Id),summarize,\n","        totalLog  = sum(TotalLog)/length(Id)) %>%\n","        ggplot(aes(reorder(Id,totalLog,decreasing=FALSE),totalLog,fill=totalLog<0.5)) + geom_bar(stat='identity') +\n","        ggtitle(\"What percent of days did participants log some kind of data? (fitbit)\") +\n","        xlab(\"Participants\") +\n","        ylab(\"Percent of days with at least one log\") +\n","        theme(axis.text.x = element_blank()) +\n","        guides(fill=guide_legend(title=\"Less than 50% of days\"))\n","\n","weight_status_chart <- sema_demo2 %>%\n","  group_by(weight_status) %>%\n","  ggplot(aes(x = weight_status, \n","             y = count, fill = weight_status)) + \n","  geom_bar(stat=\"identity\", position = \"dodge\") +\n","  xlab(\"Weight Status* calculated using BMI and CDC guidelines\") + ylab(\"Count\") +\n","  ggtitle(\"What is the weight status of female users? (Lifesnaps)\") +\n","  theme(legend.position = \"none\")\n","\n","activity_chart <- activity_status %>%\n","ggplot(aes(Activity,count,fill=Activity)) +\n","  geom_bar(stat='identity') +\n","  ggtitle(\"Do female participants get enough exercise? (Lifesnaps)\") +\n","  xlab(\"Sedentary* less than 2.5 a week of moderate and very active hours.\") +\n","  ylab(\"Participants\") +\n","  theme(legend.position = \"none\")\n","\n","weight_active_minutes_chart <- weight_activity %>%\n","ggplot(aes(weight_status,meanVeryActiveMinutes,fill=weight_status)) + geom_bar(stat='identity')\n","\n","sema_sleep_chart <- sema_sleep %>% \n","  ddply(.(SleepBadge), summarize,\n","        count = length(SleepBadge)) %>%\n","  ggplot(aes(x=reorder(SleepBadge, count, decreasing = TRUE), \n","             y=count, fill = SleepBadge)) + \n","  geom_bar(stat=\"identity\") +\n","  xlab(label = \"Quality of Sleep* more than 7 hrs of sleep is recommended\") +\n","  ylab(label = \"Number of Female Users\") +\n","  labs(title = \"How are female participants sleeping on average? (Lifesnaps)\") +\n","  theme(legend.position = \"none\")"]},{"cell_type":"markdown","id":"a457f4f9","metadata":{"papermill":{"duration":0.084632,"end_time":"2023-02-06T22:53:01.925538","exception":false,"start_time":"2023-02-06T22:53:01.840906","status":"completed"},"tags":[]},"source":["##### 4.1 Summary of analysis\n","\n","Most people wore the device for the vast majority of days in the month, with 18 people wearing it everyday, 10 people only missing 1-5 days. 24 of the 33 participants were interested in tracking their sleep. More people created sleep logs than weight logs. Surprisingly, more men than women tried mindfulness sessions but most people did very few sessions. Different logs were used by different users, and rarely consistently.  \n","\n","Most women using wearable devices appear to be of healthy weight and didn't get enough sleep on average. Overweight participants using the device to lose weight could account for them having more very active minutes on average than healthy weight participants. \n","\n","Most female participants set some step goals but only 22% of the time on average. This also indicates an interest in tracking steps. Most of the time people tracking their heart rate wear the device all day, sometimes all night too. Most of the time women wear the device all day, a lot of the time sleeping with it on."]},{"cell_type":"markdown","id":"d5f455f8","metadata":{"papermill":{"duration":0.02918,"end_time":"2023-02-06T22:53:01.982496","exception":false,"start_time":"2023-02-06T22:53:01.953316","status":"completed"},"tags":[]},"source":["<a id=\"conclusion\"></a>\n","#### 5. Share\n","This study looked at the fitbit dataset (33 participants with one month of data from 2016) and the Lifesnaps dataset (71 participants with up to 4 months of data from 2021-2022). Overall, people try manually logging data and setting goals but few do it consistently. If friction can be reduced for goal setting, people will use the device longer term."]},{"cell_type":"code","execution_count":29,"id":"34814ba8","metadata":{"execution":{"iopub.execute_input":"2023-02-06T22:53:02.041007Z","iopub.status.busy":"2023-02-06T22:53:02.039188Z","iopub.status.idle":"2023-02-06T22:53:02.728858Z","shell.execute_reply":"2023-02-06T22:53:02.725869Z"},"papermill":{"duration":0.722323,"end_time":"2023-02-06T22:53:02.732147","exception":false,"start_time":"2023-02-06T22:53:02.009824","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd7zT1P/H8U+6192XvfeUJaJsFVRwooKIAoKioqCiKKAoKOBWRBSFn1tRWW7F\ngeJG3BNliyjI5u7b23vb/P4I1Et7x+nl9l7I9/X8gwdNTpJPktP0fdMk1XRdFwAAABz9LNVd\nAAAAACoHwQ4AAMAkCHYAAAAmQbADAAAwCYIdAACASRDsAAAATIJgBwAAYBIEOwAAAJMwYbD7\n6+0BmqbZPS1CUaM+H9lS0zS7p3kg6qnMX13VVtO0xAY3isiG5/pomtbnuQ1VUS7KlLfj49H9\njk33OWq1uyXWaR9qlqJp2vL9/ngUdviKl/f9zZ00TRv46Xb1SY4cisVXuP0R65d7j9M0rd8b\nW6q7kCPXM63SNE17aXdeGW0qsT9U1hvkKDrs5Gz59KYRZ7WqV8PtcCSl1e01cPizH25WnDaQ\nuaqZ2z7rp73hIRErXu6uuaZegqZpa/OLyl5Q2fPRQ7nn1PSeO/83xbJRLhMGu1o9xotIUf7G\nV/bkR4x67L1tIlKUv+nR7TkRo95dvk1EGp47pHKL0UO5X3755dff/V25sz2SVe4qT+993rMr\nf7C36j2gT4tKmSEOkwm6tAlWAXFVxYedCnfI7L8WtWvT/4GFb/8TTDqmS4ckS+aX77146akt\nR87/WWXyh88cnNP+rls7pYWHlL3ilfXGiZiPZvE+vmT4W9ee/HlW4DDnjAN0Mzoh0SkiA9/b\nWnxgIPsbTdOMte5698/FR4WCeel2q4hctWavruvrn+0tIr2fXX/4lQRyfhCRxIa3Hf6sjhaV\nucqhArum2T1tcoOhCkw9u2myiLyzL78SKomD4uXt+f7NZ599dsWOPPVJqkv0/lUsvsLtK11l\nddGf7+kqIie//mdlFGVOT7dMFZEXd+WW0aYS+0PlvEGq/LBT4Q45rXWKiJxyx2sBo9JQwVsP\nXyYiVnv6LzmBsqfd88vtInLv+v3/DYpa8YhdE13n+Lo+Efkjr7CcZZU3H10vOi/d0/CMFxRW\nGuWzVVWArFI3dkwb/Pn23x9dK6c1CA/c9e3duq43Ov+Cv15ZsmHBazKlQ3hU3s5n9hQGNYtj\ncrOk6qgXJdND+YW67vG081i06q4lvtK6nHVJl+ouoqJiLf6oXllUuiOtPxwth52i/LWz1mU4\nE7svv22QzahUc5x57ZMzH3nlto17pv+899UetcuY/NFhj3hrjZjUIjk8JHrFK2vXKMzHetfd\n3dpcOebd/YMHprgqYZH/20z4VayIdL2x