leep, and/or heartrate. These metrics should be more forward facing than mindfulness sessions in the app."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":638.274067,"end_time":"2023-02-06T22:53:07.548148","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-02-06T22:42:29.274081","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}